import './style.css';
import './icons8.png'

function App() {
  return (
    <div className="Principal">
      <h1 className='titulo'>Pesquisar por CEP</h1>

      <input className='entrada'
      placeholder='digite o seu cep'/>
      <button className='pesquisar'>
        <img width={30} src='icons8.png'/>
      </button>
    </div>
  );
}

export default App;
